import React from "react";
import ShowTodo from "./ShowTodo";
import AddNewTodo from "./AddNewTodo";

const TodoApp = props => {
  return (
    <React.Fragment>
      <AddNewTodo />
      <ShowTodo />
    </React.Fragment>
  );
};

export default TodoApp;
